import React from 'react'
import { CaFoundation, MbaCourses, PgCourses, UgCourses } from './LandingPageData'
import {BgImg} from './Landing-imges/onlineEd.jpg'
import './LandingPage.css'

export const LandingPage = () => {
  return (
    <div className='BgImage' style={{display: 'F'}}>
        <div>
            {UgCourses.map((itemsUg) => {
                return(

                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {PgCourses.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {MbaCourses.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {CaFoundation.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}
        </div>
    </div>
  )
}
